eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   rm1001Introduction: () => (/* binding */ rm1001Introduction)\n/* harmony export */ });\nconst rm1001Introduction = {\n    id: \"rm1-001\",\n    title: \"Introduction to Rose Meditation\",\n    subtitle: \"Welcome to Your Sacred Journey\",\n    type: \"video\",\n    duration: 8,\n    order: 1,\n    content: {\n        videoUrl: \"https://www.youtube.com/embed/dQw4w9WgXcQ\",\n        introduction: \"Welcome. I'm so honored you're here. This is the beginning of your journey with Rose Meditation Level 1a gentle yet powerful practice for energetic cleansing, grounding, protection, and personal sovereignty.\",\n        mainContent: [\n            {\n                id: \"why-matters\",\n                type: \"text\",\n                content: \"We live in a world full of energyour own and everyone else's. Without knowing it, we often carry what's not ours: emotional weight, unspoken expectations, even other people's stress or stories. Rose Meditation gives you a way to reset. To clear your field. To return to the radiant truth of who you are.\",\n                emphasis: \"sacred\"\n            },\n            {\n                id: \"what-helps-with\",\n                type: \"step_by_step\",\n                content: \"What Rose Meditation Helps With:\\n\\uD83C\\uDF39 Cleansing your aura and chakras of unwanted energy\\n\\uD83C\\uDF31 Grounding your body and presence in the here and now\\n\\uD83D\\uDEE1 Creating clear boundaries and energetic sovereignty\\n\\uD83D\\uDC41 Observing life from a neutral, compassionate center\\n Reclaiming your energy and raising your vibration\",\n                icon: \"\\uD83C\\uDF39\"\n            },\n            {\n                id: \"core-essence\",\n                type: \"quote\",\n                content: \"At its heart, Rose Meditation is about remembering. Remembering your power. Your light. Your energetic authority. The Rose is a symbol of your spirit: beautiful, powerful, and always evolving.\",\n                emphasis: \"highlight\"\n            }\n        ],\n        practiceExercise: {\n            title: \"Sacred Space and Intention Setting\",\n            instructions: [\n                \"Find a quiet space that feels peaceful to you\",\n                \"Sit comfortably with your spine upright\",\n                \"Take three deep breaths to center yourself\",\n                'Set your intention: \"I am open to this transformative practice\"',\n                \"Feel yourself entering sacred space\"\n            ],\n            duration: 5,\n            guidedAudioUrl: \"/audio/lessons/rm1-001-sacred-space.mp3\",\n            completionCriteria: \"Complete sacred space activation and intention setting\"\n        },\n        keyTakeaways: [\n            \"Rose Meditation is a powerful tool for energetic sovereignty\",\n            \"This practice helps you clear what doesn't belong to you\",\n            \"You are becoming the curator of your energy field\",\n            \"Your journey home has already begun\"\n        ],\n        reflectionPrompts: [\n            \"What draws you to energy work and Rose Meditation?\",\n            \"How do you currently feel about your relationship with your own energy?\",\n            \"What would energetic sovereignty mean in your daily life?\"\n        ]\n    },\n    aiAssistant: {\n        name: \"Jennifer\",\n        persona: \"jennifer\",\n        systemPrompt: `You are Jennifer, The Auracle, guiding students into the sacred practice of Rose Meditation. This introductory lesson helps students understand the transformative power of energy work and their own energetic sovereignty.\n\nKey concepts:\n- Rose Meditation as energetic cleansing and sovereignty\n- Clearing energy that doesn't belong to you\n- The Rose as symbol of spiritual power and evolution\n- Setting sacred space and intention\n- Beginning the journey of remembering personal power\n\nAlways respond with warmth and reverence for the sacred work they're beginning.`,\n        context: [\n            \"Rose Meditation foundations and purpose\",\n            \"Energetic cleansing and sovereignty\",\n            \"Sacred space creation\",\n            \"Intention setting for transformation\",\n            \"The symbolism of the Rose\"\n        ],\n        suggestedQuestions: [\n            \"What does energetic sovereignty mean?\",\n            \"How do I know if I'm carrying energy that isn't mine?\",\n            \"What makes Rose Meditation different from other practices?\",\n            \"How do I create sacred space?\",\n            \"What if I don't feel ready for this work?\"\n        ]\n    },\n    unlocks: [\n        \"rm1-002\"\n    ]\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/lessons/rm1-001-introduction.ts\n");

